import React, {useState} from 'react';
import Axios from'axios';
import './App.css';
import Head from './partials/head'
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faCheckCircle, faExclamationCircle} from '@fortawesome/free-solid-svg-icons'

function SignIn() {
  

  const[email, setEmail] = useState("");
  const[password, setPassword] = useState("");

  const [loginStatus, setLoginStatus] = useState("")




  const Login = ()=>{
    Axios.post('http://localhost:3001/login', {
      email: email,
      password: password
    }).then((res)=>{
      
      setLoginStatus(res.data)

      if(loginStatus == "Valid"){
        alert("Valid"+loginStatus)
        return <Redirect to ='/doctor/'/>
      }

      // if(res.data.message){
      //   setLoginStatus(res.data.message)
      //   alert(loginStatus)
      // } else{
      //   setLoginStatus(res.data[0].email)
      // }
    });
  };

  

    return(
      <div>
        <Head/>
          <div>
            <nav className="navbar navbar-light navbar-expand-md navigation-clean" style={{backgroundColor: '#0072c6'}}>
              <div className="container">
                <a className="navbar-brand" href="#" style={{color: '#c4d8e2', textAlign: 'center'}}>Tele Healthcare</a>
              </div>
            </nav>
          </div>
          <div className="register-photo">
          
            <div className="form-container">
            <div className='image-holder' ></div>
              <form >
                <h2 className="text-center">
                  <strong>Sign In to your account.</strong>
                </h2>
                <div className="form-group" >
                  <input className="form-control" name="email" placeholder="Email" onChange={(e)=>{setEmail(e.target.value)}}/>
                  <div className="CheckCircle">
                  <FontAwesomeIcon icon ={faCheckCircle}  ></FontAwesomeIcon>
                  </div>
                  <div className="ExclamationCircle">
                  <FontAwesomeIcon icon ={faExclamationCircle}  ></FontAwesomeIcon>
                  </div>
                  <text className="Message">Error Message</text>
                </div>
                <div className="form-group" >
                  <input className="form-control" type="password" name="password" placeholder="Password" onChange={(e)=>{setPassword(e.target.value)}} />
                  <div className="CheckCircle">
                  <FontAwesomeIcon icon ={faCheckCircle}  ></FontAwesomeIcon>
                  </div>
                  <div className="ExclamationCircle">
                  <FontAwesomeIcon icon ={faExclamationCircle}  ></FontAwesomeIcon>
                  </div>
                  <text className="Message">Error Message</text>
                </div>
                <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" onClick={Login} style={{ backgroundColor: '#0072c6', color: '#82c6e2'}}>Sign In</button>
                </div>
              </form>
            </div>
            
          </div>
        </div>
    )

}
export default SignIn;
